Angular 5 / Material 2 - Wrong value in field after option is selected<p>I'm facing a problem with my <a href="https://material.angular.io/components/autocomplete/overview" rel="nofollow noreferrer">Angular Material 2 Autocomplete</a> fields.</p>

<p>This is my setup:</p>

<p><strong>hardwareCreate.component.ts</strong></p>

<pre><code>myControl: FormControl = new FormControl();
availableFirmware = [];
filteredFirmware: Observable&lt;any[]&gt;;
selectedFirmware = null;
selectedFirmwareName = '';



this.availableFirmware = [];

    this.terminalService.getFirmware().subscribe(firmware =&gt; {
      this.availableFirmware = firmware.firmware;
    });
    this.filteredFirmware = this.myControl.valueChanges
    .pipe(
      startWith(''),
      map(val =&gt; this.filterFirmware(val))
    );

filterFirmware(val: any): any[] {
    return this.availableFirmware.filter(firmware =&gt; {
      return firmware.name.toLowerCase().indexOf(val.toLowerCase()) &gt; -1;
    });
  }
</code></pre>

<p><strong>hardwareCreate.component.html</strong></p>

<pre><code>&lt;div class="form-group"&gt;
        &lt;mat-form-field class="example-full-width"&gt;
            &lt;input type="text" placeholder="Firmware auswhlen" aria-label="Number" matInput [formControl]="myControl" [matAutocomplete]="auto1" [(ngModel)]="selectedFirmwareName"&gt;
            &lt;mat-autocomplete #auto1="matAutocomplete"&gt;
                &lt;mat-option *ngFor="let firmware of filteredFirmware | async" [value]="firmware._id"&gt;
                    {{ firmware.name }}
                &lt;/mat-option&gt;
            &lt;/mat-autocomplete&gt;
        &lt;/mat-form-field&gt;
    &lt;/div&gt;
</code></pre>

<p>So my problem now is, that when I type I get the firmware.name attribute which is correct and looks like this:
<a href="https://i.stack.imgur.com/rWYug.png" rel="nofollow noreferrer"><img src="https://i.stack.imgur.com/rWYug.png" alt="enter image description here"></a></p>

<p>But when I now select a firmware, the <code>value</code> changes to the <code>_id</code> of  <code>firmware</code>.
<a href="https://i.stack.imgur.com/BGdy6.png" rel="nofollow noreferrer"><img src="https://i.stack.imgur.com/BGdy6.png" alt="enter image description here"></a></p>

<p>So I could change <code>[value]="firmware._id"</code> to <code>[value]="firmware.name"</code> but I need the ID for my mongodb -></p>

<pre><code>firmware: {
        type: mongoose.Schema.Types.ObjectId, 
        ref: 'Firmware'
    },
</code></pre>

<p><strong>Question:</strong>
How can I change the display value to the name, but still get the Id for my Database when the user selects a specific firmware? </p>

<hr>

<p>The solution now is a combination of both of vsoni and JEYs answers. The problem at the end was, that <code>val</code> was an object. By converting it to a string, anything works like a charme! 
Thanks to both of you!</p>

