<pre><code>public class Resource {

@Id
public String Id;
...
}
</code></pre>

<p>I also have a ResourceRepository:</p>

<pre><code>@RepositoryRestResource(collectionResourceRel = "resources", path = "resources")
public interface ResourceRepository extends MongoRepository&lt;Resource, String&gt; {
     Resource findById(@Param("Id")String Id);
}
