<p>I found online that a way to have the id property returned in the JSON when you perform a GET request like <a href="http://localhost:8080/resources/" rel="nofollow noreferrer">http://localhost:8080/resources/</a> is to change the id property to Id (uppercase i). Indeed, if the property is lowercase, I don't get back an id field but if I change it to uppercase then I get it. For a reason, I need to get back the id property so I used the uppercase i. So far, so good.</p>

<p>However, when I tried to execute the query findById included in my repository I get an exception:</p>

<pre><code>org.springframework.data.mapping.context.InvalidPersistentPropertyPath: No property id found on app.model.Resource!
</code></pre>

<p>If I change the Id property to id (lowercase i) I can execute successfully the /resources/search/findById?id=... GET request.</p>

<p>I tried creating a custom controller with a query that finds and returns a Resource based on the id that is given:</p>

<pre><code>@Controller
@RequestMapping("/resource")
public class ResourceController {

    @Autowired
    MongoOperations mongoOperations;

    @RequestMapping(value="/findById/{resourceId}/", method= RequestMethod.GET)
    @ResponseBody
    public Resource findByResourceId(@PathVariable("resourceId") String resourceId) {
        Resource resource = mongoOperations.findOne(query(Criteria.where("Id").is(resourceId)), Resource.class,"DOJ");
    }
}
</code></pre>

<p>but I receive the same error:</p>

<pre><code>org.springframework.data.mapping.context.InvalidPersistentPropertyPath: No property id found on app.model.Resource!
</code></pre>

<p>Any idea on how to both have the id property displyed in the JSon and be able to findById?</p>

