MongoDB - how to pass data through find().count()?<p>I am practicing building a simple Express app with MongoDB. I created an endpoint that will search for a user by name and then render the page with the stored data from the DB. I tried to integrate some code to handle when a profile is not found, but it breaks the app.</p>

<p>This code works- the profile page renders as expected:</p>

<pre><code>app.get('/profiles/:name', (req, res) =&gt; {
    // calling the model
    Profile
        .find({ "name.first": req.params.name })
        .then(profileArray =&gt; {
            let profile = profileArray[0];
            let img =
                `&lt;img class="ui rounded image" src="http://api.adorable.io/avatar/250/${profile.name.first}${profile.age}" /&gt;`
            res.render('profile', { profile, img });
        })
        .catch(error =&gt; {

            if (error.reason === "ValidationError") {
                console.log(error);
                let response404 = error;
                res.render('add', { response404 });
            }
            else {
                console.log(error);
                res.render('add');
            }

        });
});
</code></pre>

<p><strong>But when I integrate the following code- between <code>find()</code> and <code>then()</code> - it breaks the app:</strong></p>

<pre><code>    .count()
    .then(count =&gt; {
        if (count &lt; 1) {
            return Promise.reject({
                code: 404,
                reason: "ValidationError",
                message: "Profile not found. Please create a profile."
            })
        };
    })
</code></pre>

<p><strong>Here is the full endpoint code with the snippet that causes the crash:</strong></p>

<pre><code>app.get('/profiles/:name', (req, res) =&gt; {
    // calling the model
    Profile
        .find({ "name.first": req.params.name })
        .count()
        .then(count =&gt; {
            if (count &lt; 1) {
                return Promise.reject({
                    code: 404,
                    reason: "ValidationError",
                    message: "Profile not found. Please create a profile."
                })
            };
        })
        .then(profileArray =&gt; {
            let profile = profileArray[0];
            let img =
                `&lt;img class="ui rounded image" src="http://api.adorable.io/avatar/250/${profile.name.first}${profile.age}" /&gt;`
            res.render('profile', { profile, img });
        })
        .catch(error =&gt; {

            if (error.reason === "ValidationError") {
                console.log(error);
                let response404 = error;
                res.render('add', { response404 });
            }
            else {
                console.log(error);
                res.render('add');
            }

        });
});
</code></pre>

<p><strong>It throws this error: "TypeError: Cannot read property '0' of undefined".
It is referring to the second <code>then()</code> where I am trying to access the array returned from <code>find()</code>.</strong></p>

<p>It seems like the data from <code>find()</code> is getting lost. How can I pass the found document through <code>count()</code> and the first <code>then()</code>?</p>

<p>One thing to note. When I integrate the error handling code, I reject the promise and render a new page with a form. That part works, but when trying to render the page with a name that does exist in the DB it breaks. I'm losing the data somewhere along the chain. Let me know if you need anything clarified. Thanks.</p>

